import React from 'react'

import { NavLink } from 'react-router-dom'




export default function NavBar() {
  return (
    <nav>
      <NavLink to='/' style={navStyle}>Home</NavLink>
      <NavLink to='/about' style={navStyle}>About</NavLink>
    </nav>
  )
}
